import React, { useState } from "react";
import { Block } from "./style";

const Todos = () => {
  const [state, setState] = useState(
    [
        {id: 1, title: 'dasda'},
    ]
  );

  return (
    <Block>
      <table border="1">
        <thead>
          <tr>
            <td>Names</td>
            <td>#</td>
          </tr>
        </thead>
        <tbody>
          {state.map((value, id) => (
            <tr>
              <td>{value.title}</td>
              <td>
                <button>Delete</button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </Block>
  );
};

export default Todos;
